sys_variable_value.value:
(function execute(inputs, outputs) {

  var name = inputs.name.replace(/ /g,'');
  var cn = inputs.cn;
  cn = encodeURIComponent(cn);
  var url = 'https://api.scryfall.com/cards/search?q=set:'+inputs.set+'+'+name+"+cn:'"+cn + "'";
 outputs.url = url;
})(inputs, outputs);

